INSERT INTO `landing_page` (`id`, `key`, `type`, `value`, `created_at`, `updated_at`) VALUES
(1, 'hero', 'section', '{\"Heading\":\"Streamline Your Business with CoreXGen CRM\",\"SubHeading\":\"Intelligent Customer Relationship Management that transforms how you connect, engage, and grow your business.\"}', '2025-01-21 14:11:27', '2025-01-21 14:11:27'),
(2, 'features', 'section', '{\"Heading\":\"Powerful Features for Modern Businesses\",\"SubHeading\":\"CoreXGen offers comprehensive tools to manage your customer relationships\",\"Options\":[{\"Heading\":\"Tasks Pipeline\",\"SubHeading\":\"Visualize and optimize your tasks process with intuitive pipeline management.\"},{\"Heading\":\"Customer Insights\",\"SubHeading\":\"Deep analytics and 360-degree customer view to understand your clients better.\"},{\"Heading\":\"Capture Leads\",\"SubHeading\":\"Web to lead capture online in one click, don\'t miss out your single opportunity.\"}]}', '2025-01-21 14:11:27', '2025-01-21 14:11:27'),
(3, 'solutions', 'section', '{\"Heading\":\"Custom Solutions for Every Business\",\"SubHeading\":\"CoreXGen adapts to your unique business needs with flexible, scalable solutions.\",\"Options\":[\"Leads Management\",\"Clients Management\",\"Proposal Management\",\"Estimates Management\",\"Contracts Management\",\"Products & Services Management\",\"Invoices Management\",\"Projects Management\",\"Tasks Management\",\"Custom Fields\",\"Event Calendar\",\"Users & Employees Managment\",\"Roles & Permissions Managment\",\"Much More...\"]}', '2025-01-21 14:11:27', '2025-01-21 14:11:27'),
(4, 'plans', 'section', '{\"Heading\":\"Simple, Transparent Pricing\",\"SubHeading\":\"Choose a plan that grows with your business.\"}', '2025-01-21 14:11:27', '2025-01-21 14:11:27'),
(5, 'testimonials', 'section', '{\"Heading\":\"What Our Customers Say\",\"Options\":[{\"Message\":\"CoreXGen transformed our sales process. The insights are incredible!\",\"Customer Name\":\"Sarah Johnson\",\"Position\":\"CEO\",\"Company\":\"TechStartup Inc.\",\"LOGO\":\"\\/img\\/100.svg\"},{\"Message\":\"Seamless integrations and powerful automation. A game-changer for our business!\",\"Customer Name\":\"Mike Rodriguez\",\"Position\":\"Sales Director\",\"Company\":\"GlobalSales Co.\",\"LOGO\":\"\\/img\\/100.svg\"},{\"Message\":\"The customer insights feature has dramatically improved our customer relationships\",\"Customer Name\":\"Emily Chen\",\"Position\":\"Marketing Director\",\"Company\":\"InnovateNow\",\"LOGO\":\"\\/img\\/100.svg\"}]}', '2025-01-21 14:11:27', '2025-01-21 14:11:27'),
(6, 'footer', 'section', '{\"Heading\":\"Intelligent CRM that helps businesses grow and succeed.\",\"SubHeading\":\"All Rights Reserved.\"}', '2025-01-21 14:11:27', '2025-01-21 14:11:27');
